import React from "react";
import {
  Box,
  Card,
  CardActions,
  Link,
  CardContent,
  CardMedia,
  Button,
  Typography,
} from "@mui/material";
import BusinessCenterIcon from "@mui/icons-material/BusinessCenter";

const Cart2 = () => {
  return (
    <Box>
      <BusinessCenterIcon />
    </Box>
  );
};

export default Cart2;
